import styled from 'styled-components';

const Navbar = styled.div`
    display: flex;
    width: 100%;
    height: 60px;
`;

const MenuListLeft = styled.ul`
    display: flex;
    list-style-type: none;
    padding-left: 0;

    li {
      padding: 0 20px;
    }
`;

export default {
    MenuList,
    Navbar
}
